import React from 'react';
import Signup from '../src/components/signup';
import Login from '../src/components/login';
import { Account } from './components/account';

export default () => {

  return (
    <Account>
      <h2>Registrar</h2>
      <Signup />
      <hr /><br /> 
      <h2>Loguear</h2>
      <Login />
    </Account>
  );
};
